    value: 'ON JUNE 16 FLAT CREEK MANAGEMENT, LLC WIRED $2,462.64 INTO THE COMMITTEE''S
      ACCOUNT.  THIS WIRE TRANSFER WAS IN ERROR BY FLAT CREEK MANAGEMENT, LLC.  FLAT
      CREEK MANAGEMENT, LLC IS A COMPANY THAT PROCESSED THE COMMITTEE''S ONLINE CONTRIBUTIONS.  THE
      $2,462.64 REPRESENTED AMOUNTS THAT FLAT CREEK BELIEVED WAS ON DEPOSIT.  IN FACT
      THEY HAD TRANSFERED THE CONTRIBUTIONS IN OCTOBER AND DECEMBER 2009, AND JANUARY
      2010.  THE COMMITTEE HAD PREVIOUSLY REPORTED THE CONTRIBUTIONS ON THE RESPECTIVE
      REPORTS. THE COMMITTEE CONTACTED FLAT CREEK AND FLAT CREEK NOW ADMITS THAT THE
      WIRE TRANSFER WAS IN ERROR, AND REQUESTED THAT THE AMOUNT BE REPAID.  ON JULY
      19, 2010 THE COMMITTEE ISSUED A CHECK TO FLAT CREEK TO REFUND THIS AMOUNT. THE
      REFUND WILL BE REPORTED ON THE JULY 2010 REPORT, PER THE FEC''S INSTRUCTION,
      ON LINE 21a/

